let FilterBrands = () => {
  return (
    <div>
      <select name="isAvailable">
        <option value="all">All</option>
        <option value="all">Filter by Sector: Primary</option>
        <option value="all">Filter by Sector: Secondary</option>
        <option value="all">Filter by Sector: Tertiary</option>
      </select>
    </div>
  );
};

export default FilterBrands;
